            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "If you were to travel towards an observer/object, the time dilation effect would be the same as if you were moving away from the observer. In other words, the time dilation effect is symmetrical, and it does not matter whether you are moving towards or away from the observer. The only thing that matters is the relative velocity and gravitational potential between the two objects.\r\u003cbr\u003e\r\u003cbr\u003eFor example, if you were on a rocket ship traveling towards an observer at a high speed, the time dilation effect would be the same as if you were on a rocket ship moving away from the observer at the same speed. In both cases, time would appear to pass more slowly for you compared to the observer, due to the difference in relative velocity and gravitational potential.",
              "textOriginal": "If you were to travel towards an observer/object, the time dilation effect would be the same as if you were moving away from the observer. In other words, the time dilation effect is symmetrical, and it does not matter whether you are moving towards or away from the observer. The only thing that matters is the relative velocity and gravitational potential between the two objects.\r\n\r\nFor example, if you were on a rocket ship traveling towards an observer at a high speed, the time dilation effect would be the same as if you were on a rocket ship moving away from the observer at the same speed. In both cases, time would appear to pass more slowly for you compared to the observer, due to the difference in relative velocity and gravitational potential.",
